import * as style from "../../css/light/indexMenu";

export default function renderIndexMenu(profileDataToRender) {
  const removeIndexItem = (list) => {
    list.slice(1, -1)
    console.log(list[0])
    return list
  }

  const renderIndexMenuItemMain = () => {
    return (
      <div style={style.containerMainStyle}>
        {profileDataToRender[0].at(0)['index']}
      </div>
    )
  }

  const renderIndexMenuItemsOther = () => {
    let list = removeIndexItem(profileDataToRender[0])

    return Object.keys(list[0]).map((item, i) => (
      <div style={style.indexStyle}>
        {list[0][i]['index']}
      </div>
    ))
  }

  return (
    <div style={style.containerOtherStyle}>
      {renderIndexMenuItemMain()}
      {renderIndexMenuItemsOther()}
    </div>
  )
}
